INSERT INTO public.school (school_id, name, type, total_students, established_date, description, location_id, image_id) VALUES (89, 'D.C. Everest Senior High', 'High School', 1, '1970-01-01', 'The D.C. Everest School District is a public school district serving the city of Schofield, the villages of Weston, Hatley, Rothschild, and Kronenwetter, and the towns of Ringle and Easton in central Wisconsin.', null, null);
INSERT INTO public.school (school_id, name, type, total_students, established_date, description, location_id, image_id) VALUES (90, 'University of Wisconsin–Platteville', 'University', 1, '1970-01-01', 'University of Wisconsin–Platteville is a public university located in Platteville, Wisconsin, United States. Part of the University of Wisconsin System.', null, null);
INSERT INTO public.school (school_id, name, type, total_students, established_date, description, location_id, image_id) VALUES (78, 'CW Jefferys', 'High School', 1, '1970-01-01', 'The #1 Art school in Toronto. Famous alumni include Rahal Balasuriya of Sajja Securities.', null, null);
INSERT INTO public.school (school_id, name, type, total_students, established_date, description, location_id, image_id) VALUES (55, 'Ryserson University', 'University', 1, '1970-01-01', 'Ryerson University is a public research university located in downtown Toronto, Ontario. Its urban campus surrounds the Yonge-Dundas Square, located at the busiest intersection in downtown Toronto.', null, null);
INSERT INTO public.school (school_id, name, type, total_students, established_date, description, location_id, image_id) VALUES (52, 'University of Waterloo', 'University', 1, '1970-01-01', 'The University of Waterloo is a public research university with a main campus located in Waterloo, Ontario. The main campus is located on 404 hectares of land in ''Uptown'' Waterloo, adjacent to Waterloo Park', null, null);
INSERT INTO public.school (school_id, name, type, total_students, established_date, description, location_id, image_id) VALUES (53, 'York University', 'University', 1, '1970-01-01', 'York University is a public research university in Toronto, Ontario, Canada. It is Canada''s third-largest university. York University has approximately 53,000 students, 7,000 faculty and staff, and 295,000 alumni worldwide.', null, null);
INSERT INTO public.school (school_id, name, type, total_students, established_date, description, location_id, image_id) VALUES (54, 'University of Toronto', 'University', 1, '1970-01-01', 'The University of Toronto is a public research university in Toronto, Ontario, Canada, situated on the grounds that surround Queen''s Park.', null, null);
INSERT INTO public.school (school_id, name, type, total_students, established_date, description, location_id, image_id) VALUES (56, 'Hogwarts School of Witchcraft and Wizardry', 'Witchcraft and Wizardry', 1, '1970-01-01', 'Hogwarts School of Witchcraft and Wizardry, shortened Hogwarts, is a fictional British school of magic for students aged eleven to eighteen, and is the primary setting for the first six books in J.K. Rowling''s Harry Potter series.', null, null);
INSERT INTO public.school (school_id, name, type, total_students, established_date, description, location_id, image_id) VALUES (91, 'University of Wisconsin–Marathon County', 'University', 1, '1970-01-01', 'The University of Wisconsin–Marathon County (UWMC), one of the University of Wisconsin Colleges, is a two-year campus of the University of Wisconsin System. It is located near downtown Wausau, Wisconsin.', null, null);
INSERT INTO public.school (school_id, name, type, total_students, established_date, description, location_id, image_id) VALUES (92, 'Northview Heights Secondary School', 'High School', 1, '1970-01-01', 'Northview Heights Secondary School is a secondary school for grades 9 to 12 in Toronto, Ontario, Canada. It is located in Toronto''s north end at the intersection of Bathurst Street and Finch Avenue.', null, null);
INSERT INTO public.school (school_id, name, type, total_students, established_date, description, location_id, image_id) VALUES (94, 'Auburn University', 'University', 1, '1970-01-01', 'Auburn University (AU or Auburn) is a public research university located in Auburn, Alabama, United States. With more than 22,000 undergraduate students and a total of more than 28,000 students and 1,200 faculty members, it is one of the largest universities in the state as well as one of two public flagship universities in the state.', null, null);